import './Allpost.css'
import axios from 'axios'
function Allpost() {
    const [images, setImages] = useState([]);
    useEffect(() => {
        getPost()
    }, [])
    const getPost = async () => {
        try {
            const response = await axios.get('http://localhost:4000/get-all-post')
            const SaveToimg = response.data.data
            console.log(SaveToimg)
        } catch (e) {
            console.log(e)
        }
    }
    return (
        <>
            <div className='post-container'>
                <div className='images'>
                {images.map((img, index) => (
                        <img key={index} alt='Error' src={img} />
                    ))}
                    <img alt='Error' src={images} />

                </div>
            </div>
        </>
    )
}

export default Allpost
